import React from 'react'
import { useHistory } from "react-router-dom";
import "./header.css"

function Header(props) {
  const history = useHistory();
  const { Packages, Products, MyRental, EditProfile } = props;

  const logout = () => {
    history.push("/");
  }
  return (
    <div>
      <div className='Header'>
        <div>
          <img src={require("logo.png")} alt="a" />
          <span>Home/{Packages}{Products}{MyRental}{EditProfile}</span>
        </div>
        <div>
          <button className='HeaderButton'>My Cart</button>
          <button onClick={logout} className='HeaderButton'>Logout</button>
        </div>
      </div>
    </div>
  )
}

export default Header
